import React from "react";
import Header from "./Header.jsx";
import Footer from "./Footer.jsx";
import Note from "./Note.jsx";
import notes from "../notes.js";
import Create from "./Create.jsx";

function App(){
    return (<div>
        <Header />
        <Create />
        {notes.map(note => (<Note 
        key = {note.key}
        title = {note.title}
        content = {note.content}
    />))}
        <Footer />
    </div>);
}

export default App;
